script: |
  super -f text -I q5534.spq | sort > q5534.out

inputs:
  - name: q5534.spq
    data: |
      SELECT - col0 AS col0, 35 + col2 + + col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN + 84 AND - col0;
  - name: tab2

outputs:
  - name: q5534.out
    data: |
      -46	104
      -64	139
      -75	168
